import React, { useState } from "react";

function TopNavItem(props) {

    const [isMouseOver, setMouseOver] = useState(false);

    function handleMouseOver() {
        setMouseOver(true);
    }

    function handleMouseLeave() {
        setMouseOver(false);
    }

    return <a style={{ backgroundColor: isMouseOver && "#EDEBE9", fontWeight: isMouseOver && "bold" }} onMouseOver={handleMouseOver} onMouseLeave={handleMouseLeave} id={props.title} href={props.href}><div className="topBarText">{props.title}</div></a>;
}

export default TopNavItem;
